import React from "react";
import "./text.css";

function Contact() {
  const handleSubmit = () => {
    // event.preventDefault();
    // ... get data form
    // ... submit to API or something
  };
  return (
    <div className="Box">
      <label>
        Gmail :
        <input type="string" />
      </label>
      <br />
      <br />
      <label>
        LinkedIn :
        <input type="string" />
      </label>
      <br />
      <br />
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
}

export default Contact;
